import sys

l, r = map(int, sys.stdin.readline().split())

def is_2_3_integer(n):
    if n % 2 == 0 or n % 3 == 0:
        return False
    for i in range(5, int(n ** 0.5) + 1, 6):
        if n % i == 0 or n % (i + 2) == 0:
            return False
    return True

count = 0
for i in range(l, r + 1):
    if is_2_3_integer(i):
        count += 1

print(count)

